                return solve(d2, k + m + -1, s, n, ans)
        return 0
    n = len(s)
    ans = [-1]
    for i in range(1, n // 2 + 1):
        ans[0] = -1
        d = s[0:i]
        if solve(d, i, s, n, ans) and ans[0] != -1:
            return ans[0]
    return -1
